#include "MainWindow.h"
#include "Game.h"

Game::Game(MainWindow& wnd)
	:
	wnd(wnd),
	gfx(wnd),
	mandoPosX(400.0f),
	mandoPosY(300.0f),
	mandoWidth(32.0f),
	mandoHeight(52.0f),
	blasterPosX(100.0f),
	blasterPosY(100.0f),
	blasterWidth(23.0f),
	blasterHeight(14.0f),
	introPosX(300.0f),
	introPosY(200.0f),
	introHeight(150.0f),
	introWidth(200.0f)
{
}

void Game::Go()
{
	gfx.BeginFrame();	
	UpdateModel();
	ComposeFrame();
	gfx.EndFrame();
}

void Game::UpdateModel()
{
	ScreenBoundary(mandoPosX, mandoPosY, mandoWidth, mandoHeight);
	MoveMando(mandoPosX, mandoPosY);

	if (BoxCollision(mandoPosX, mandoPosY, blasterPosX, blasterPosY, mandoWidth, mandoHeight, blasterWidth, blasterHeight))
	{
		isBlasterCollected = true;
	}
}

